import React from "react";
import "carousel_tile.scss";

const carouselTile = () => {
  return (
    <div className="tile-container">
      <div className="tile-container__label-container">
        <svg></svg>
        <h3 className="tile-container__label-container__label">
          The idle rocks
        </h3>
      </div>
      <h1 className="tile-container__header">The idle rocks</h1>
      <h2 className="tile-container__subheader">St mawes, cornwall</h2>
    </div>
  );
};

export default carouselTile;
